import React from 'react'

import { useParams } from 'react-router-dom'

import '../styles/input.css'

const Editar = ({post, setPost}) => {

    return (
        <div className='xl:container mx-auto grid place-items-center h-screen font-sans'>
            <div className='bg-white shadow-md border border-gray-200 rounded-lg max-w-sm p-4 sm:p-6 lg:p-8 dark:bg-gray-800 dark:border-gray-700'>
                <div className='form-group'>
                <label for="password" class="text-sm font-medium text-gray-900 block mb-2 dark:text-gray-300">Your password</label>
					<input type="text" name="title" id="title" className="bg-gray-50 border border-gray-300 text-gray-900 sm:text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-600 dark:border-gray-500 dark:placeholder-gray-400 dark:text-white" required/>
                </div>
            </div>
        </div>
    )
}

export default Editar;
